import React, { useContext } from 'react';
import { DataContext } from '../context/DataContext';

const MyPage = () => {
  const { isLoggedIn, tempAccount } = useContext(DataContext);

  if (!isLoggedIn) {
    return <p className="text-center mt-10">로그인이 필요합니다.</p>;
  }

  return (
    <div className="flex justify-center items-center min-h-screen bg-gray-100">
      <div className="bg-white shadow-md rounded p-6 w-full max-w-md mx-auto">
        <h1 className="text-2xl font-bold mb-4 text-center">마이페이지</h1>
        <p><strong>이름:</strong> {tempAccount.name}</p>
        <p><strong>이메일:</strong> {tempAccount.email}</p>
        <p><strong>나이:</strong> {tempAccount.age}</p>
        <p><strong>거주 지역:</strong> {tempAccount.location}</p>
        <p><strong>선호 포지션:</strong> {tempAccount.position}</p>
        <p><strong>실력 수준:</strong> {tempAccount.skillLevel}</p>
        <p><strong>운동 빈도:</strong> {tempAccount.frequency}</p>
      </div>
    </div>
  );
};

export default MyPage;
